import React, { useState, useEffect } from "react";
import axios from "axios";
import { format } from "date-fns";
import { ru } from "date-fns/locale";
import { useParams, useNavigate } from "react-router-dom";

const MonthlyData = () => {
  const { month } = useParams();
  const [data, setData] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get("http://localhost:5000/api/data");
        setData(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  const groupByMonth = (data) => {
    return data.reduce((groups, item) => {
      const date = new Date(item.date);
      const monthYear = format(date, "MMMM yyyy", { locale: ru });

      if (!groups[monthYear]) groups[monthYear] = [];
      groups[monthYear].push(item);

      return groups;
    }, {});
  };

  const monthName = format(new Date(month), "MMMM yyyy", { locale: ru });
  const monthData = groupByMonth(data)[monthName] || [];

  return (
    <div>
      <div className="header">
        <h1>Data Table for {monthName}</h1>
        <button onClick={() => navigate("/")}>Back to Current Month</button>
      </div>
      <div className="data">
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Brand</th>
              <th>Driver</th>
              <th>Customer</th>
              <th>Route Number</th>
              <th>Hours</th>
              <th>True/False</th>
              <th>Vehicle Number</th>
              <th>Price</th>
              <th>Last Edited By</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {monthData.map((item) => (
              <tr key={item._id}>
                <td>{item.date}</td>
                <td>{item.brand}</td>
                <td>{item.driver}</td>
                <td>{item.customer}</td>
                <td>{item.routeNumber}</td>
                <td>{item.hours}</td>
                <td>{item.isTrue ? "True" : "False"}</td>
                <td>{item.vehicleNumber}</td>
                <td>{item.price}</td>
                <td>{item.updatedBy}</td>
                <td>
                  <button
                    onClick={() =>
                      // Handle delete or other actions
                      console.log("Delete item", item._id)
                    }
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default MonthlyData;
